import React from "react";
import styled from "styled-components";


class Group13960 extends React.Component {
  render() {
    const { className } = this.props;

    return (
      <Group14034 className={`group-14034 ${className || ""}`}>
        <Rectangle71 className="rectangle-71-2"></Rectangle71>
        <Rectangle72 className="rectangle-72-1"></Rectangle72>
        <Rectangle72 className="rectangle-73-1"></Rectangle72>
      </Group14034>
    );
  }
}

const Group14034 = styled.div`
  position: absolute;
  width: 8px;
  top: 77px;
  left: 658px;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  min-height: 32px;

  &.group-14034.group-14034-1 {
    left: 674px;
  }

  &.group-14034.group-13959-1 {
    left: 659px;
