  &.group-14034.group-13959-2 {
    top: 700px;
    left: 659px;
  }

  &.group-14034.group-13959-3 {
    left: 1393px;
  }

  &.group-14034.group-13959-4 {
    top: 700px;
    left: 1400px;
  }

  &.group-14034.group-13965 {
    margin-left: 694px;
    position: unset;
    top: unset;
    left: unset;
  }

  &.group-14034.group-13965-1 {
    margin-left: 694px;
