    top: 767px;
    left: 924px;
  }

  &.group-14034.group-13965-3 {
    top: 69px;
    left: 1136px;
  }
`;

const Rectangle71 = styled.div`
  width: 8px;
  height: 8px;
  background-color: var(--spring-wood-2);
  border-radius: 50px;
`;

const Rectangle72 = styled.div`
  width: 8px;
  height: 8px;
  margin-top: 4px;
  background-color: var(--spring-wood-2);
  border-radius: 50px;
`;

const Rectangle711 = styled.div`
  .group-14034.group-14034-1 & {
    background-color: var(--sonic-silver);
    border-radius: 5px;
  }
`;

const Rectangle712 = styled.div`
  .group-14034.group-13959 & {
    background-color: var(--mine-shaft);
  }
`;

const Rectangle713 = styled.div`
