    background-color: var(--white);
  }
`;

const Rectangle715 = styled.div`
  .group-14034.group-13959-3 & {
    background-color: var(--white);
  }
`;

const Rectangle716 = styled.div`
  .group-14034.group-13959-4 & {
    background-color: var(--sonic-silver);
  }
`;

const Rectangle717 = styled.div`
  .group-14034.group-13965 & {
    background-color: var(--mist-gray);
  }
`;

const Rectangle718 = styled.div`
