  }
`;

const Rectangle7110 = styled.div`
  .group-14034.group-13959-5 & {
    background-color: var(--white);
  }
`;

const Rectangle7111 = styled.div`
  .group-14034.group-13965-3 & {
    background-color: var(--mist-gray);
  }
`;

export default Group13960;
